import React, { useState } from "react";

export const ToDoBoard = () => {
  const [todo, setTodo] = useState([]);

  return (
    <div id="todoBoard">
      <h1>TO DO LIST</h1>
      <h3>What to do</h3>
      <p>{todo}</p>
      <input type="text" />
    </div>
  );
};
